Input = ""

# Input = "dabAcCaCBAcCcaDA"

from functools import cache

@cache
def CanReact(a, b):
  Difference = ord(a) - ord(b)
  if Difference == 32 or Difference == -32:
    return(True)
  return(False)

def RemoveUnit(String, a):
  Value = 0
  for Index in range(len(String)):
    Index -= Value
    if Index >= len(String):
      break
    if String[Index] == a:
      Value += 1
      String = String[:Index] + String[Index + 1:]
  a = chr(ord(a) + 32)
  Value = 0
  for Index in range(len(String)):
    Index -= Value
    if Index >= len(String):
      break
    if String[Index] == a:
      Value += 1
      String = String[:Index] + String[Index + 1:]
  return(String)

def ReactedString(String):
  while True:
    Value = 0
    Breakout = True
    for Index in range(len(String) - 1):
      Index -= Value
      if Index >= len(String) - 1:
        break
      if CanReact(String[Index], String[Index + 1]):
        Breakout = False
        Value += 1
        String = String[:Index] + String[Index + 2:]
    if Breakout:
        break
  return(String)

Minimum = float('inf')
for x in range(26):
  print(x + 1)
  x += 65
  NewInput = RemoveUnit(Input, chr(x))
  NewInput = ReactedString(NewInput)
  ThisLength = len(NewInput)
  if ThisLength < Minimum:
    Minimum = ThisLength
print(Minimum)